import React from "react";
import { BrowserRouter as router, Router } from 'react-router-dom';
import 'bootstrap/dist/css/bootstrap.min.css';
import { Navbar, Button } from "reactstrap";

const App = () => {
  return (
    <Route>
      <Navbar>
        <h1>WeEat</h1>
        <Button>
          Home
      </Button>
      </Navbar>
    </Route>


  );
};
export default App;
